function makeColorTable(colors) {
    // this.makeColorTable([Color.black, Color.white, Color.red, Color.blue]).openInWorld()
    var morph = Morph.makeRectangle(new Rectangle(0,0,30, 100));
    var layouter = new lively.morphic.Layout.VerticalLayout();
    layouter.borderSize = 0;
    layouter.spacing = 0;
    morph.setLayouter(layouter)
    morph.setFill(Color.gray)
    morph.disableGrabbing();
    morph.enableDragging();
    morph.addScript(function onDragStart(evt) {});
    morph.addScript(function onDragEndt(evt) {});

    morph.addScript(function onDrag(evt) {
        var found = this.submorphs.detect(function(ea) {
            ea.fullContainsWorldPoint(evt.mousePoint)
        });
        if (found)
            morph.color = found.getFill();
    });

    colors.forEach(function(ea) {
        var colorBox = Morph.makeRectangle(new Rectangle(0,0,30,30));
        morph.addMorph(colorBox);
        colorBox.setFill(ea);
        colorBox.ignoreEvents()
    });


    return morph
}

