function loadPartsOfCategory(categoryName) {
    this.removeParts();
    this.setSelectedPartItem(null);
    if (!categoryName) return;
    var webR;
    if (categoryName == "*all*") {
        this.showMsg("loading all...");
        webR = new WebResource(this.defaultPartsBinURL()).beAsync();
        lively.bindings.connect(webR, 'subDocuments', this, 'onLoadAll');
        webR.getSubElements(10)
    } else if (categoryName == "*latest*") {
        this.showMsg("loading latest...");
        webR = new WebResource(this.defaultPartsBinURL()).beAsync();
        lively.bindings.connect(webR, 'contentDocument', this, 'onLoadLatest');
        webR.propfind('infinity')
    } else if (categoryName == "*search*") {
        this.showMsg("searching...");
        webR = new WebResource(this.defaultPartsBinURL()).beAsync();
        lively.bindings.connect(webR, 'subDocuments', this, 'allURLs', {
            converter: function(subDocuments) {
                return subDocuments.invoke('getURL')
            }
        });
        lively.bindings.connect(this, 'allURLs', this, 'onSearch', {
            removeAfterUpdate: true});
        webR.getSubElements(10)
    } else {
        this.addPartsOfCategory(categoryName)
    }
}

