function ensureAnnotationLayer() {
    module('lively.LayerableMorphs').load(true);
    if (!("ScriptAnnotationLayer" in Global)) {
        cop.create("ScriptAnnotationLayer").refineClass(
            lively.morphic.Morph,{

            addScriptAnnotationFor : function(funcOrString) {
                var func = Function.fromString(funcOrString);
                if (!func.name) return;

                // source not changed
                if (this[func.name] && 
                    this[func.name].toString() === func.toString()) return;

                if (!this.scriptAnnotations) this.scriptAnnotations = {};

                var annotation = {time : new Date()};
                if (this.world() && this.world().getUserName && 
                    this.world().getUserName()) {
                    annotation.user = this.world().getUserName();
                }

                this.scriptAnnotations[func.name] = annotation;
            },

