function findTargets() {

    var targets = [];
    var gather = function(obj, getter, setter) {
        if (!obj[getter]) return;
        var color = obj[getter]();
        if (this.fromColor.equals(color))
            targets.push({object: obj, selector: setter, color: color})
    }.bind(this)

    $world.withAllSubmorphsDo(function(ea) {
        gather(ea, 'getBorderColor', 'setBorderColor')
        gather(ea, 'getFill', 'setFill')
        gather(ea, 'getTextColor', 'setTextColor')
    }.bind(this));

    this.targets = targets;
}

